const Education =() =>{
    return (<div className="container mx-auto mt-5">
        <div className="font-bold text-orange-600 text-lg">Education & Certifaction</div>
        <div className="flex flex-col justify-center">
            <div className="flex flex-row gap-x-10">
                <div className="hover:text-orange-500 hover:scale-100 transition duration-300">B.C.Sc Computer Science</div>
                <div className="hover:text-orange-500 hover:scale-100 transition duration-300">2012 Feb ~ 2017 Dec</div>
            </div>
        </div>

    </div>);
}

export default Education;
